import {EComponentGroupTitle, EComponentTitle, TComponentGroup} from "~/interfaces/material_components";

const { FEEDBACK } = EComponentGroupTitle;
const {PROGRESS, DIALOG, SNACKBAR, BACKLOG} = EComponentTitle;

const componentGroup: TComponentGroup = {
  iconType: "user",
  title: "Feedback",
  components: [
    { title: "Progress", props: [] },
    { title: "Dialog", props: [] },
    { title: "Snackbar", props: [] },
    { title: "Backdrop", props: [] }
  ]
};

export default componentGroup;
